module.exports = function() {
  const SysTray = require('systray').default
  const opn = require('opn')
  const PORT = process.env.PORT || 3000

  const icon =
    process.platform ?
      '' :
      ''

  const tray = new SysTray({
    menu: {
      icon,
      title: '',
      tooltip: '',
      items: [
        {
          title: '',
          enabled: true
        },
        {
          title: '',
          enabled: true
        },
        {
          title: '',
          enabled: true
        }
      ]
    },
    debug: false,
    copyDir: true
  })

  tray.onClick(action => {
    switch (action.seq_id) {
      case 0: {
        opn(`http://localhost:${PORT}/settings`)
        break
      }
      case 1: {
        opn(`http://localhost:${PORT}/wishList`)
        break
      }
      case 2: {
        process.exit()
      }
    }
  })
}